/**
 * ProgramNode is the base of all derived programNodes
 */
export interface ProgramNode {
    type: string;
    version: string;
    parameters?: {
        [key: string]: any;
    };
    lockChildren?: boolean;
    locked?: boolean;
    allowsChildren?: boolean;
    isSuppressed?: boolean;
}
/**
 * BranchNode is used to build a subtree structure using the {@link TreeBuilder}
 */
export interface BranchNode extends ProgramNode {
    readonly children: Array<BranchNode | ProgramNode>;
}
